import React, { Component } from "react";
import "./style.css"
class Contact extends Component {


  render() {
  return (
      <section className="container">
          <h2 className="contactT text-center">Contact Me</h2>
          <form action="/action_page.php" className="form-horizontal">
              <div className="mb-3">
                  <label for="name" className="form-label">Name:</label>
                  <input type="text" className="form-control" id="name" name="name" placeholder="Enter First and Last Name..." />
              </div>
              <div className="mb-3">
                  <label for="email" className="form-label">Email address:</label>
                  <input type="email" className="form-control" id="email" placeholder="name@example.com" />
              </div>
              <div className="mb-3">
                  <label for="message" className="form-label">Message:</label>
                  <textarea className="form-control" id="message" placeholder="Enter your email..."
                      rows="3"></textarea>
              </div>
              <div className="mb-3">
                  <button type="submit" className="btn btn-primary mb-3 rounded-pill viewProject my-2 px-4">Send Message</button>
              </div>
          </form>
      </section>
    );
  }
};

export default Contact;
